function point_video(event){	
	jQuery('#video-page [data-role=content]').empty();
	var reference = event.currentTarget.getAttribute('point-to');	
	var elem = jQuery('<iframe src="'+reference+'" frameborder="0" allowfullscreen></iframe>');
	elem.appendTo('#video-page [data-role=content]');
}

